    false,nt"url": null,nt"notes": "This plan gives a basic description of
    what avian botulism is and the locations on the Don Edwards San Francisco Bay National
    Wildlife Refuge where botulism outbreaks frequently occur.  These locations include
    the Artesian/Mallard Slough and lower Coyote Creek.  Outbreaks are most common in
    the fall.  When an outbreak is suspected, surveys are conducted to assess the situation.
     The plan states that sick birds should be taken to wildlife rehabilitation centers,
    and dead birds are frozen until they can be incinerated.",nt"license_title":
